如果類型為1,則星期值將從星期日開始算起,並且星期日的值為1,囙此星期六的值就是7。

如果類型為2,則星期值將從星期一開始算起,並且星期一的值為1,囙此星期日的值就是7。

如果類型為3,則星期值將從星期一算起,並且星期一的值為0,囙此星期日的值就是6。`,example:"7",require:"o",repeat:"n",type:"rangenumber"}]},{n:"DAY",t:6,d:"以數位格式返回特定日期所在的當月幾號。",a:"以數位格式返回特定日期所在的當月幾號。",m:[1,1],p:[{name:"serial_number",detail:"要從中選取具體幾號的日期。必須是以下一種:對包含日期的儲存格的引用、返回日期類型的函數或者數位。",example:"DATE(1969",require:"m",repeat:"n",type:"rangeall"}]},{n:"DAYS",t:6,d:"返回兩個日期之間的天數。",a:"返回兩個日期之間的天數。",m:[2,2],p:[{name:"end_date",detail:"計算中要使用的結束日期。必須是以下一種:對包含日期的儲存格的引用、返回日期類型的函數或者數位。",example:"2011-3-15",require:"m",repeat:"n",type:"rangeall"},{name:"start_date",detail:"計算中要使用的開始日期。必須是以下一種:對包含日期的儲存格的引用、返回日期類型的函數或者數位。",example:"2011-2-1",require:"m",repeat:"n",type:"rangeall"}]},{n:"DAYS360",t:6,d:"按照每年360天,返回兩個日期之間的差（用於計算利息）。",a:"按照每年360天,返回兩個日期之間的差（用於計算利息）。",m:[2,3],p:[{name:"start_date",detail:"計算中要使用的開始日期。必須是以下一種:對包含日期的儲存格的引用、返回日期類型的函數或者數位。",example:"DATE(1969",require:"m",repeat:"n",type:"rangeall"},{name:"end_date",detail:"計算中要使用的結束日期。必須是以下一種:對包含日期的儲存格的引用、返回日期類型的函數或者數位。",example:"7",require:"m",repeat:"n",type:"rangeall"},{name:"method",detail:`[可選 - 默認為FALSE（）] - 訓示要使用哪種天數計算方法。

FALSE -採用美國（NASD）方法時,如果起始日期為某月的最後一天,為便於計算,會將起始日期的當月幾號更改為30。此外,如果結束日期是所在月份的最後一天,而且起始日期在其所在月的30號之前,則將結束日期更改為結束日期之後那個月的第一天,否則將結束日期更改為該月的30號。

